App = Em.Application.create({
    rootElement: $(".view-container")
}), App.Router.map(function() {
    this.resource("subjects", function() {
        this.resource("subject", {
            path: "/:id"
        }, function() {
            this.route("edit");
        }), this.route("new");
    }), this.route("insert", {
        path: "/insert"
    });
}), App.IndexRoute = Ember.Route.extend({
    setupController: function(a) {
        a.set("model", [ "a", "b", "c" ]);
    }
}), App.Subject = DS.Model.extend({
    name: DS.attr("string"),
    age: DS.attr("int")
}), App.SubjectsRoute = Ember.Route.extend({
    model: function() {
        return this.store.find("subject");
    }
}), App.SubjectRoute = Ember.Route.extend({
    model: function(a) {
        return this.store.find("subject", a.id);
    }
}), App.SubjectEditController = Ember.ObjectController.extend({
    actions: {
        save: function() {
            var a = this.get("model");
            this.transitionToRoute("subject", a);
        }
    }
}), App.SubjectsNewController = Ember.ObjectController.extend({
    actions: {
        create: function() {
            var a = this.get("name");
            console.log(a);
            var b = this.get("age");
            console.log(b);
            var c = this.store.createRecord(App.Subject, {
                name: a,
                age: b
            });
            c.save(), console.log(c);
        }
    }
}), App.ShellRestAdapter = DS.RESTAdapter.extend({
    pathForType: function(a) {
        return a;
    }
}), App.ApplicationAdapter = App.ShellRestAdapter.extend({
    host: "http://localhost:8082/api"
}), App.Store = DS.Store.extend({});